import React, {Component} from 'react';
import {Form, Input, Message, Button} from 'semantic-ui-react';


class EntryForm extends Component {
      render(){
          return(
              <Form>
                  <Form.Field>
                      <label>Enter in Lottery</label>
                      <Input 
                        label="ether"
                        labelPosition="right"/>
                  </Form.Field>
                  <Button primary>
                      Entry
                  </Button>
              </Form>
          )
      }
}

export default EntryForm;
